def protein(rna):
    #create a codon dictionary
    bases = ['u', 'c', 'a', 'g'] #rna strings
    codontable = [a + b + c for a in bases for b in bases for c in bases]
    aminoacids = 'FFLLSSSSYY**CC*WLLLLPPPPHHQQRRRRIIIMTTTTNNKKSSRRVVVVAAAADDEEGGGG' #any letter of the alphabet can be used except B, J, O, U, X, and Z
    codondict = dict(zip(codontable, aminoacids))
    #create list of codons in RNA
    rna = rna.lower() #lower the rna cases
    codonfragments = [rna[i:i + 3] for i in range(0, len(rna), 3)]
    #translate RNA to protein
    protein = ""
    for codon in codonfragments:
        protein += codondict[codon]
    return protein[:-1]
print(protein(""))
